import java.util.LinkedHashSet;

public class Main {
    public static void main(String[] args) {
        LinkedHashSet<Integer> set = new LinkedHashSet<>();

        // Initial elements
        set.add(3); 
        set.add(5);
        set.add(7);
        set.add(9);

        int toggle = 10;
        int sum = 0;
        for (int i = 0; i < toggle; i++) {
            sum += i;
        }

        // Conditional write point
        if (sum % 2 == 0) {
            /* write */ set.add(14);
        } else {
            set.add(15);
        }

        // Misleading operations that do not affect the actual read point
        if (toggle > 5) set.add(21); else set.add(18);
        set.remove(3);
        set.remove(5);

        // Convert set to array to enable reading by index
        Integer[] array = set.toArray(new Integer[0]);

        /* read */ int ret = array[2];

        System.out.println(ret);
    }
}
